site.headStyle:
/***********************\
    Loader widget
\***********************/

body.silex-runtime {
    background-color: black;
    transition: background-color 0s .3s linear;
}

body.silex-runtime>* {
    opacity: .1;
    transition: opacity .3s ease-in;
}

body.silex-runtime.loaded>* {
    opacity: initial;
}

body.loaded {
    background-color: initial;
}

body.silex-runtime:before {
    content: '';
    border: 16px solid #f3f3f3;
    border-top: 16px solid #3498db;
    border-radius: 50%;
    width: 120px;
    height: 120px;
    animation: spin 2s linear infinite;
    position: absolute;
    top: 50vh;
    left: 50vw;
    z-index: 100;
}

body.silex-runtime.loaded:before {
    content: none
}

@keyframes spin {
    0% {
        transform: rotate(0deg);
    }
    100% {
        transform: rotate(360deg);
    }
}


/***********************\
    /Loader widget
\***********************/@media (max-width: 480px) {
  body.silex-runtime.is-not-active .show-when-active {
    display: none;
  }

  body.silex-runtime.is-active .show-when-not-active {
    display: none;
  }
}

@media (min-width: 480px) {
  .close-btn,
  .open-btn {
    cursor: pointer;
  }

  body.silex-runtime .show-when-active {
    bottom: 100%;
    top: unset;
    position: absolute !important;
  }

  html {
    background: linear-gradient(to left, #ff7e5f, #feb47b);
    min-width: 1000px;
    height: 100%;
  }
}

html {
  background: linear-gradient(to left, #ff7e5f, #feb47b);
  height: 100%;
}

body.silex-runtime {
  transition: .2s all ease-out;
}

body.is-active.silex-runtime>.section-element {
  margin-bottom: -1px;
}

body.is-active.silex-runtime {
  box-shadow: 0 -2px 10px 8px rgba(0, 0, 0, 0.11);
}

body.is-active .show-when-not-active {
  height: 0;
}

@media (min-width: 480px) {
  body.is-active.silex-runtime {
    transform: translateY(100px);
  }
}

@media (min-width: 1000px) {
  body.is-active.silex-runtime {
    transform: scale(0.9, 0.9) translateY(100px);
  }
}

@media (min-width: 480px) {
  .silex-runtime .thumb > * {
    opacity: 0;
    transition: opacity .5s;
  }
  .silex-runtime .thumb:hover > * {
    opacity: 1;
  }
}

